  `is_publish` int(1) NOT NULL DEFAULT '1' COMMENT '是否发布 0 发布 1 不发布',
  `is_top` int(1) DEFAULT '1' COMMENT '0 置顶 1 不置顶',
  `add_time` bigint(20) NOT NULL COMMENT '添加时间',
  `update_time` bigint(20) NOT NULL COMMENT '更新时间',
